   //         name:"",
  //          phoneNumber:"",
  //          address:"",
  //          email:"",
  //          password:"",

       // },
       // validationSchema: signUpSchema 
   // })




    return(
        <div className={styles.mainPage}>
        <div className={styles.pageHeader}>
            Welcome to <span className={styles.logo}>CoinBounce</span>
        </div>
        <TextBox type="text" placeholder="Enter your Name" name="name"  />
        <TextBox type="password" placeholder="Enter your Phone Number" name="phoneNumber"  />
        <TextBox type="password" placeholder="Enter your Address" name="address" />
        <TextBox type="text" placeholder="Enter your Email" name="email" />
        <TextBox type="password" placeholder="Enter your Password" name="password" />
        <button onClick={HandleLogin} className={styles.LoginButton}>
            Create Account
        </button>
        </div>
    )
}

export default SignUp
